import React from "react";

function AddRecipe() {
    return (
        <form>
            <label>Add Recipe</label><br/>
            <input type="text" placeholder="Recipe Name"/><br/>
            <input type="url" placeholder="image"/><br/>
            <textarea type="text" placeholder="ingredients" height="600px"/><br/>
            <textarea type="text" placeholder="directions" height="600px"/><br/>
            <button type="submit">Submit</button>

        </form>
    )
}
export default AddRecipe;
